function Board(t){this.squares=t,this.grid=[],this.filledSquares=0,this.gameBoard=document.getElementById("game")}Board.prototype.buildBoard=function(){var t;for(t=0;t<this.squares*this.squares;t++)this.grid[t]=new Square},Board.prototype.update=function(t,i){this.grid[t].setSymbol(i),this.filledSquares++},Board.prototype.displayBoard=function(){var t,i,r='<div class="board">';for(t=0;t<this.grid.length;t++)r+='<div class="square" data-num="'+t+'">'+this.grid[t].getSymbol()+"</div>";this.gameBoard.innerHTML=r},Board.prototype.getSymbols=function(){var t=[];for(i=0;i<this.grid.length;i++)t.push(this.grid[i].getSymbol());return t};